import requests

# Function to identify objects in an image using Azure Computer Vision API
def identify_objects(image_url, api_key):
    endpoint = "https://<your-region>.api.cognitive.microsoft.com/vision/v3.0/analyze"
    params = {
        'visualFeatures': 'Objects',
        'language': 'en'
    }
    headers = {
        'Ocp-Apim-Subscription-Key': api_key,
        'Content-Type': 'application/json'
    }
    data = {'url': image_url}
    
    response = requests.post(endpoint, json=data, params=params, headers=headers)
    response.raise_for_status()
    result = response.json()
    objects = [obj['object'] for obj in result['objects'] if 'object' in obj]
    return objects

# Function to generate a story based on objects detected in an image
def generate_story(objects):
    # Example stories for some objects
    object_stories = {
        "cat": "Once upon a time, in a cozy little house, there lived a mischievous cat named Whiskers.",
        "dog": "In the vast green fields, a loyal dog named Rover roamed, his tail wagging with excitement.",
        "tree": "Deep in the enchanted forest, a majestic tree stood tall, its branches whispering secrets to the wind.",
        # Add more object stories as needed
    }
    
    story = []
    for obj in objects:
        if obj in object_stories:
            story.append(object_stories[obj])
        else:
            story.append(f"No story found for object: {obj}")
    
    return "\n".join(story)

# Your Azure Computer Vision API key
api_key = 'YOUR_AZURE_API_KEY'

# URLs of the three images
image_urls = [
    "data:image/jpeg;base64,",
    "data:image/jpeg;base64,",
    "data:image/jpeg;base64,"
]

# Identify objects in each image and generate a story
for i, url in enumerate(image_urls, start=1):
    print(f"Image {i}:")
    objects = identify_objects(url, api_key)
    print("Objects detected:", objects)
    story = generate_story(objects)
    print("Generated story:")
    print(story)
    print("\n")
